import React from 'react';
import './styles/main.scss';
import Content from './components/Content/Content';
import NavBar from './components/NavBar/NavBar';
import HowItWorks from './components/HowItWorks/HowItWorks';

function App() {
  return (
    <div className="App">
      <NavBar />
      <Content />
      <HowItWorks />
    </div>
  );
}

export default App;
